//http://gregcodemexico.com/cd/hack/rastreo.php



var app = {
  element: {
    1: {
      name: 'face',
      tracker: 1,
      strings: {
        1: 'Face'
      },
      cols: {
        hover: '#F04B23',
        norm: '#F79341'
      }
    }, // Face
    2: {
      name: 'hair',
      tracker: 1,
      strings: {
        1: 'Hair'
      },
      cols: {
        hover: '#D36329',
        norm: '#82431D'
      }
    }, // Hair
    3: {
      name: 'eye',
      tracker: 1,
      strings: {
        1: 'EILeft',
        2: 'EOLeft',
        3: 'EPLeft',
        4: 'EBLeft',
        5: 'EIRight',
        6: 'EORight',
        7: 'EPRight',
        8: 'EBRight'
      },
      cols: {
        hover: '#282422',
        norm: '#FFFFFF'
      }
    }, // Eyes
    4: {
      name: 'nose',
      tracker: 1,
      strings: {
        1: 'NoseU',
        2: 'NoseL',
        3: 'NoseR',
        4: 'NoseB'
      },
      cols: {
        hover: '#C16D48',
        norm: '#A54C11'
      }
    }, // Nose
    5: {
      name: 'mouth',
      tracker: 1,
      strings: {
        1: 'MouthI',
        2: 'MouthL',
        3: 'MouthA'
      },
      cols: {
        hover: '#3F2617',
        norm: '#63554C'
      }
    }  // Mouths
  }, 
  color: {
    element: {
      1: {
        name: 'skin',
        tracker: 1,
        collection: {
          1: {
            face: '#FEE1B9',
            highlight: '#FDC786',
            bg: '#CC9966'
          },
          2: {
            face: '#FBC5A4',
            highlight: '#F9976A',
            bg: '#BF9765'
          },
          3: {
            face: '#A87256',
            highlight: '#6F331D',
            bg: '#FDEEC7'
          }
        },
      }, // Skin
      2: {
        name: 'hair',
        tracker: 1,
        collection: {
          1: '#82421D',
          2: '#FFCC33',
          3: '#FF3300',
          4: '#000000'
        },
        change: function(e){
          console.log(e);
        }
      }, // Hair
      3: {
        name: 'eyes',
        tracker: 1,
        collection: {
          1: '#4D1A00',
          2: '#008000',
          3: '#0066FF'
        }
      }  // Eyes
    },
    prep: function(i, x){
      // We build the arrow name.
        var dir;
        if(x === 0){
          dir = 'Right';
        } else {
          dir = 'Left';
        }
        var name = "C" + app.capitalize(app.color.element[i].name) + dir;
      // Then we bind the hover functions
        document.getElementById(name).addEventListener('mouseenter', function(){
          TweenMax.to('#' + name, 0.8, {morphSVG: '#' + name + 'H', fill: app.color.fill(i, x), ease:Elastic.easeOut});
        });
        document.getElementById(name).addEventListener('mouseleave', function(){
          if(i === '1'){
            var color = app.color.element[i].collection[app.color.element[i].tracker].face;
          } else {
            var color = app.color.element[i].collection[app.color.element[i].tracker];
          }
          TweenMax.to('#' + name, 0.8, {morphSVG: '#' + name, fill: color, ease:Elastic.easeOut});
        });
      // And then we bind the click functions
        document.getElementById(name).addEventListener('click', function(e){
          var length = app.indexer(app.color.element[i]);
          var elem;
          if(e.target.id.indexOf('Right') !== -1){
            elem = e.target.id.replace('Right', 'Left');
            if(app.color.element[i].tracker === length){
              app.color.element[i].tracker = 1;
            } else {
              app.color.element[i].tracker++;
            };
          } else {
            elem = e.target.id.replace('Left', 'Right');
            if(app.color.element[i].tracker === 1){
              app.color.element[i].tracker = length;
            } else {
              app.color.element[i].tracker--;
            };
          };
          color = app.color.element[i].collection[app.color.element[i].tracker]
          if(i === '1'){
            console.log(color);
            TweenMax.to('#Face1', 0.8, {fill: color.face, stroke: color.face, ease: Circ.easeOut});
            TweenMax.to('#NoseU1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('#NoseL1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('#NoseR1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('#NoseB1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('#MouthA1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('#EOLeft1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('#EORight1', 0.8, {fill: color.highlight, ease: Circ.easeOut});
            TweenMax.to('body', 0.8, {backgroundColor: color.bg, ease: Circ.easeOut});
            TweenMax.to('#' + elem, 0.4, {fill: color.face});
          } else {
            if(i === '2'){
              TweenMax.to('#Hair1', 0.8, {fill: color, stroke: color, ease: Circ.easeOut});
              TweenMax.to('#EBLeft1', 0.8, {fill: color, stroke: color, ease: Circ.easeOut});
              TweenMax.to('#EBRight1', 0.8, {fill: color, stroke: color, ease: Circ.easeOut});
            } else {
              TweenMax.to('#EPLeft1', 0.8, {fill: color, ease: Circ.easeOut});
              TweenMax.to('#EPRight1', 0.8, {fill: color, ease: Circ.easeOut});
            }
            TweenMax.to('#' + elem, 0.4, {fill: color});
          }
        });
    },
    fill: function(i, x){
      var t;
      var length = app.indexer(app.color.element[i].collection);
      if(x === 0){
        if(app.color.element[i].tracker === length){
          t = 1;
        } else {
          t = app.color.element[i].tracker + 1;
        }
      } else { 
        if(app.color.element[i].tracker === 1){
          t = length;
        } else {
          t = app.color.element[i].tracker - 1;
        }
      }
      
      if(i === '1'){
        return app.color.element[i].collection[t].face; 
      } else {
        return app.color.element[i].collection[t];
      }
    }
  },
  DOM: {
    container: null,
    svg: null
  },
  capitalize: function (string) {
    return string.charAt(0).toUpperCase() + string.slice(1);
  },
  indexer: function(obj){
    var size = 0, key;
    for (key in obj) {
        if (obj.hasOwnProperty(key)) size++;
    }
    return size;
  },
  prep: function(string, i){
    // Lets bind the needed hover events.
    //console.log(document.getElementById(elemString));
    document.getElementById(string).addEventListener('mouseenter', function(){
      TweenMax.to('#' + string, 0.8, {morphSVG: '#' + string + 'H', fill: app.element[i].cols.hover, ease:Elastic.easeOut});
    });
    document.getElementById(string).addEventListener('mouseleave', function(){
      TweenMax.to('#' + string, 0.8, {morphSVG:'#' + string, fill: app.element[i].cols.norm, ease:Elastic.easeOut});
    });
    // Then let's bind the click event
    document.getElementById(string).addEventListener ('click', function(){
      if(string.indexOf('Right') !== -1){
        if(app.element[i].tracker === 3){
          app.element[i].tracker = 1;
        } else {
          app.element[i].tracker++;
        };
      } else {
        if(app.element[i].tracker === 1){
          app.element[i].tracker = 3;
        } else {
          app.element[i].tracker--;
        };
      }
      for(var x in app.element[i].collection[app.element[i].tracker]){
            TweenMax.to(app.element[i].collection[1][x], 1, { morphSVG:{shape:app.element[i].collection[app.element[i].tracker][x]}, ease:Elastic.easeInOut });
          }
    });
  },
  random: {
    init: function(){
      var random = document.querySelector('#random');
      // Remove the click event to avoid click spamming, and then set up the timeline.
      random.removeEventListener('click', app.random.init);
      // This timeline calls the actual timeline function on each repitition. 
      // This is the function handling the randomizations.
      var t = new TimelineMax({onStart: app.random.timeline, repeat: 4, onRepeat:app.random.timeline, onComplete: function(){
        TweenMax.to('body', 0.4, {backgroundColor: app.color.element[1].collection[app.color.element[1].tracker].bg, ease: Circ.easeOut});
        TweenMax.to('#CSkinLeft', 0.4, {fill: app.color.element[1].collection[app.color.element[1].tracker].face, ease: Circ.easeOut});
        TweenMax.to('#CSkinRight', 0.4, {fill: app.color.element[1].collection[app.color.element[1].tracker].face, ease: Circ.easeOut});
        TweenMax.to('#CEyesLeft', 0.4, {fill: app.color.element[3].collection[app.color.element[3].tracker], ease: Circ.easeOut});
        TweenMax.to('#CEyesRight', 0.4, {fill: app.color.element[3].collection[app.color.element[3].tracker], ease: Circ.easeOut});
        TweenMax.to('#CHairLeft', 0.4, {fill: app.color.element[2].collection[app.color.element[2].tracker], ease: Circ.easeOut});
        TweenMax.to('#CHairRight', 0.4, {fill: app.color.element[2].collection[app.color.element[2].tracker], ease: Circ.easeOut});
        random.addEventListener('click', app.random.init);
      }});
      t.to('body', 0.5, {autoAlpha: 1});
    },
    timeline: function(){
      // Here we loop through each element and generate a random tracker number to be used for the next iteration therof.
      for(var i in app.element){
        var ran = app.element[i].tracker;
        while(ran === app.element[i].tracker){
          app.element[i].tracker = Math.floor(Math.random() * 3) + 1;
        }
      };
      // Let's do the same for the colours.
      for(var i in app.color.element){
        var ran = app.color.element[i].tracker;
        while(ran === app.color.element[i].tracker){
          app.color.element[i].tracker = Math.floor(Math.random() * app.indexer(app.color.element[i]) + 1);
        }
      }
      // Then we create the new timeline
      var k = new TimelineMax();
      // And we add the morph Tweens
      for(var i in app.element){
        for(var x in app.element[i].collection[1]){
          k.to(app.element[i].collection[1][x], 0.5, {morphSVG: app.element[i].collection[app.element[i].tracker][x], ease: Linear.easeNone}, i * 0.1);
        }
      }
      // And then we add the color Tweens
      for(var i in app.color.element){
        if(i === '1'){
            k.to('#Face1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].face, stroke: app.color.element[i].collection[app.color.element[i].tracker].face, ease: Circ.easeOut}, i * 0.1);
            k.to('#NoseU1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
            k.to('#NoseL1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
            k.to('#NoseR1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
            k.to('#NoseB1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
            k.to('#MouthA1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
            k.to('#EOLeft1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
            k.to('#EORight1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker].highlight, ease: Circ.easeOut}, i * 0.1);
          } else {
            if(i === '2'){
              k.to('#Hair1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker], stroke: app.color.element[i].collection[app.color.element[i].tracker], ease: Circ.easeOut}, i * 0.1);
              k.to('#EBLeft1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker], stroke: app.color.element[i].collection[app.color.element[i].tracker], ease: Circ.easeOut}, i * 0.1);
              k.to('#EBRight1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker], stroke: app.color.element[i].collection[app.color.element[i].tracker], ease: Circ.easeOut}, i * 0.1);
            } else {
              k.to('#EPLeft1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker], ease: Circ.easeOut}, i * 0.1);
              k.to('#EPRight1', 0.8, {fill: app.color.element[i].collection[app.color.element[i].tracker], ease: Circ.easeOut}, i * 0.1);
            }
          }
      }
    }
  },
  init: function(){
    // Hide the pop-up box
    TweenMax.set('#Punk', {autoAlpha: 0, x: 30});
    TweenMax.set('#Punk2', {autoAlpha: 0, x: 30});
    TweenMax.set('#Punk3', {autoAlpha: 0});
    /* Get the container div - and set some initial styles. */
    app.DOM.container = document.querySelector('.container');
    TweenMax.set(app.DOM.container, { position: 'absolute', left: '50%', xPercent: -50 });
    TweenMax.set('svg', { visibility: 'visible'})
    /* Loop through different elements and prepare them for use */
    for(var i in app.element){
      // First we build an index of the different paths that make up any given part in the SVG image
      // This is all based on the strings defined in app.element.strings
      app.element[i].collection = new Object();
      for(var k = 1; k < 4; k++){
        app.element[i].collection[k] = new Object();
        for(var x in app.element[i].strings){
          app.element[i].collection[k][x] = '#' + app.element[i].strings[x] + k;
        }
      }
      // Then we create the functionality for the left and right arrows
      // We run the loop twice, once setting the left arrow, and once setting the right.
      for(var k = 0; k < 2; k++){
        // Set the direction
        var dir;
        if(k === 0){
          dir = 'Right';
        } else {
          dir = 'Left'
        };
        // Build the arrow element ID, its an SVG polygon. Then send the element off to the app.prep
        // function to bind some event handlers. Why are we doing this?
        // Otherwise all the functions will share the same 'i' variable, and therefor share the last bound event!
        app.prep(app.capitalize(app.element[i].name) + dir, i);
      }
    }
    // Now we bind the color controls.
    // Let's first bind the nav arrows hover functions.
    for(var i in app.color.element){
      for(var x = 0; x < 2; x++){
        // Send all the info off to the tracker function.
        app.color.prep(i, x);
      }
    }
    app.element[3].tracker = 2;
    for(var i in app.element[3].collection[1])
    {
      TweenMax.set(app.element[3].collection[1][i], { morphSVG:{shape:app.element[3].collection[2][i]}, ease:Elastic.easeInOut });
    }
    app.element[5].tracker = 3;
    for(var i in app.element[5].collection[1])
    {
      TweenMax.set(app.element[5].collection[1][i], { morphSVG:{shape:app.element[5].collection[3][i]}, ease:Elastic.easeInOut });
    }
    // Here we bind the events that will handle a random avatar generation.
    var random = document.querySelector('#random');
    random.addEventListener('mouseenter', function(){
      TweenMax.to(random, 0.4, {fill: '#006600', ease: Circ.easeOut});
      TweenMax.to('#Punk', 0.4, {autoAlpha: 1, x: 0, ease: Bounce.easeOut});
      TweenMax.to('#Punk2', 0.4, {autoAlpha: 1, x: 0, ease: Bounce.easeOut});
      TweenMax.to('#Punk3', 0.4, {autoAlpha: 1, ease: Circ.easeOut});
    });
    random.addEventListener('mouseleave', function(){
      TweenMax.to(random, 0.4, {fill: '#000000', ease: Circ.easeOut});
      TweenMax.to('#Punk', 0.4, {autoAlpha: 0, x: 20, ease: Circ.easeOut});
      TweenMax.to('#Punk2', 0.4, {autoAlpha: 0, x: 20, ease: Circ.easeOut});
      TweenMax.to('#Punk3', 0.4, {autoAlpha: 0, ease: Circ.easeOut});
    });
    random.addEventListener('click', app.random.init);
  }
}

app.init();



</script>
